function add_events(){const sign_up_norm=document.getElementById("create_ac_portal"),sign_in_port=document.querySelectorAll("#sign_in_portal");sign_up_norm.addEventListener("click",sign_up_norm_fuc);for(let i=0;i<sign_in_port.length;i++)sign_in_port[i].addEventListener("click",sign_in_port_fuc);return!1}function sign_up_norm_fuc(e){const to_sign_up=document.getElementById("t-2");return to_sign_up.click(),!1}function sign_in_port_fuc(e){const test_back=document.getElementById("t-1");return test_back.click(),!1}$(document).ready(()=>{add_events()});